    let handleObject = feature => {
        if (feature === null) {
            return '';
        } else if (typeof(feature)=='object') {

            return feature;
        }
    }
    let fields = ["id", "to_id", "travel_time", "population"];

        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }

    geo_json_07d6b75d30e77a7fb47bc11ad8f15060.bindTooltip(
    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature => {
        if (feature === null) {
            return '';
        } else if (typeof(feature)=='object') {
            return JSON.stringify(feature);
        } else {
            return feature;
        }
    }
    let fields = ["id", "NAMEOFFACI"];
    let aliases = ["id", "NAMEOFFACI"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }

  "sticky": true,
